import React, { useEffect, useState } from 'react';
import '../styles/login.css';
import ProfilePic from '../styles/MyImage.jpeg';
import sigmatec from '../styles/Sigmatec.png';
import ummat from '../styles/Ummat.png';
import IconPro from '../styles/IconPro.png';
import { FaFire } from 'react-icons/fa'; // Example for Firebase
import { DiFlutter } from 'react-icons/di'; // Example for Flutter
import { DiCsharp } from 'react-icons/di'; // Example for C#



const MainPage = () => {
    const [typedName, setTypedName] = useState('');
    const [hasScrolledToProjects, setHasScrolledToProjects] = useState(false); // Track if the user has scrolled to projects section
    const fullName = "  I'M     CHANGEZI";

    const phrases = [
        '        A STUDENT           ',
        '        A FRONTEND DEVELOPER               ',
        '        A BACKEND DEVELOPER            ',
        'A MOB APP DEVELOPER        ',
        '         AN OPENAI EXPERT               '
    ];

    const [typedPhrase, setTypedPhrase] = useState('');
    const [phraseIndex, setPhraseIndex] = useState(0);
